import React from "react";
import { Nav, Navbar } from "rsuite";

const BottomNav = () => {
    return(
        <div>
            <Navbar>
                <Nav.Item><button className="primaryButton">+ Project</button></Nav.Item>
            </Navbar>
        </div>
    )
}

export default BottomNav
